class User(Table):
    table_name = 'user'
    fields = {
        'id': NumberField(),
        'version': NumberField(),
        'login': StringField(),
        'email': StringField(),
        'password': StringField(),
        'is_disabled': BoolField(),
        'company': StringField()
    }


class OrgUser(Table):
    table_name = 'org_user'
    fields = {
        'org_id': NumberField(),
        'user_id': NumberField(),
        'role': StringField()
    }


class DfLogTest(Table):
    table_name = 'df_log_android-2020-03-*'
    fields = {
        'zone': StringField(),
        'version': StringField(),
        'deviceid': StringField(),
        'is_translated': BoolField()
    }


class ProductInfo(Table):
    table_name = 'productinfo'
    fields = {
        'p_id': StringField(),
        'product_name': StringField(),
        'platform': StringField()
    }

class UserStat(Table):
    table_name = 'user_stat'
    fields = {
        'time_day': StringField(),
        'p_id': StringField(),
        'version': StringField(),
        'used': NumberField()
    }

